import React from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';
import HomePage from './pages/homepage/homepage.component';

function App() {
  return (
    <div>
      <Switch>
        <Route exact to="/" component={HomePage} />
      </Switch>
    </div>
  );
}

export default App;
